import React from 'react';

async function index() {
    return fetch('/')
    .then(response => response.json());
}

export default function Projects(){

    const contentLoaded = async () => {
        const data = await index();
        console.log(data);
    }

    return (
        <div>
            <br/>
            <h1>Projects</h1>
            <button onClick={contentLoaded}>Status</button>
        </div>
    )
}
